import logo from './logo.svg';
import './Results.css';

function Results() {

  return (

    <div className="Results">
     <div className="Results-box">
       <p class="p1">spotify Results</p>
        <input type="text" id="link" name="link" placeholder="insert a spotify link!"></input> <br/>
          <button class="button">find the color</button>
      </div>
    </div>
  );
}

export default Results;
